import React, { useState, useEffect } from 'react';
import { AiOutlineLogout } from 'react-icons/ai';
import axios from 'axios';
import './HomeWorker.css';
import EditProfile from '../Edit/EditProfile'; // Ensure this path is correct

const generateDefaultImageURL = (email) => {
  const firstLetter = email ? email[0].toUpperCase() : 'U'; // Default to 'U' if email is not available
  return `https://via.placeholder.com/100x100.png?text=${firstLetter}`;
};

function HomeWorker() {
  const [showTable, setShowTable] = useState(false);
  const [unitTestData, setUnitTestData] = useState({
    type: '',
    language: '',
    projectName: '',
    status: 'Pending'
  });
  const [unitTests, setUnitTests] = useState([]);
  const [showProfileMenu, setShowProfileMenu] = useState(false);
  const [showEditProfile, setShowEditProfile] = useState(false);
  const [user, setUser] = useState({ username: '', email: '', firstName: '', profileImage: '' }); // Include firstName
  const [errorMessage, setErrorMessage] = useState('');
  const [showProfileView, setShowProfileView] = useState(false);

  useEffect(() => {
    const fetchWorkers = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/workers'); // استبدل بالمسار الصحيح
        setWorkers(response.data);
        setError('');
      } catch (error) {
        console.error('Error fetching workers:', error);
        setError('فشل في جلب بيانات العمال');
      }
    };

    fetchWorkers();
  }, []);


  const handleViewProfile = () => {
    setShowProfileView(true); 
  };

  const handleCloseProfileView = () => {
    setShowProfileView(false);
  };

  return (
    <div className="home-worker">
      <header className="home-header">
        <div className="header-left">
          <div className="dropdown">
            <button
              className="dropdown-btn"
              onClick={() => setShowProfileMenu(!showProfileMenu)}
              aria-haspopup="true"
              aria-expanded={showProfileMenu}
            >
              <div className="profile-header">
                <img
                  src={user.profileImage || generateDefaultImageURL(user.email)}
                  alt="Profile"
                  className="profile-image"
                />
                <div className="profile-details">
                  <span className="profile-username">{user.username || 'Loading...'}</span>
                  <span className="profile-email">{user.email || 'Loading...'}</span>
                </div>
              </div>
            </button>

            {showProfileMenu && (
              <div className="profile-menu">
                <div className="profile-info">
                  <img
                    src={user.profileImage || generateDefaultImageURL(user.email)}
                    alt="Profile"
                    className="profile-image"
                  />
                  <p><strong>{user.username || 'Loading...'}</strong></p>
                  <p>{user.email || 'Loading...'}</p>
                </div>
                <button onClick={handleViewProfile}>View Profile</button>
                <button onClick={() => setShowEditProfile(true)}>Edit Profile</button>
                {showEditProfile && (
                  <div className="overlay">
                    <div className="edit-profile-container">
                      <button className="close-button" onClick={() => setShowEditProfile(false)}>
                        &times;
                      </button>
                      <EditProfile
                        user={user}
                        onSave={(updatedData) => setUser(updatedData)}
                        onCancel={() => setShowEditProfile(false)}
                      />
                    </div>
                  </div>
                )}
              </div>
            )}
          </div>
          <button className="logout-btn" onClick={() => window.location.href = '/login'}>
            <span className="logout-icon"><AiOutlineLogout size={24} /></span>
            Log Out
          </button>
          <button className="add-button" onClick={() => setShowTable(!showTable)}>
            {showTable ? 'Hide Table' : '+ New Test'}
          </button>
        </div>
        <div className="header-right">
          <span>Worker</span>
        </div>
      </header>

      {errorMessage && <div className="error-message">{errorMessage}</div>}

      {showProfileView && (
        <div className="profile-view">
          <h2>Profile Information</h2>
          <img
            src={user.profileImage || generateDefaultImageURL(user.email)}
            alt="Profile"
            className="profile-image"
          />
          <p><strong>First Name:</strong> {user.firstName || 'Loading...'}</p>
          <p><strong>Email:</strong> {user.email || 'Loading...'}</p>
          <button onClick={handleCloseProfileView}>Close</button>
        </div>
      )}

      {/* Rest of your component code */}
    </div>
  );
}

export default HomeWorker;
